import React from 'react'

const TodoList = ({data}) => {

    const {id, ...itemProps} = data;
    console.log(itemProps);

    return (
        <div>
            <ul>
                {data.map(({label}) => {
                    return (
                            <li>
                                {label}
                            </li>
                        )
                })}

            </ul>
        </div>
    )
};

export default TodoList;
